export const getCrestAsset = (playerColor: string): CrestAsset | null => {
  const colorMap: { [key: string]: string } = {
    'r': 'red',
    'b': 'blue', 
    'y': 'yellow',
    'g': 'green',
  };
  
  const color = colorMap[playerColor];
  if (!color) return null;
  
  return crestAssets[color] || null;
};

export const getCrestColor = (playerColor: string): string => {
  switch (playerColor) {
    case "r":
      return "#DC2626"; // Red
    case "b":
      return "#2563EB"; // Blue
    case "y":
      return "#7C3AED"; // Purple
    case "g":
      return "#16A34A"; // Green
    default:
      return "#DC2626";
  }
};
